ベタつかないのに、１日中キープ！秘密はサロン発想「髪の芯からスタイリング」　・空気含んで　ふっくら　つやめく　ボブ＆ミディ<br><br><br>モッズ・ヘア インナーグラマー ワックス キュートミディ 65g<br>ベタつかないのに1日中スタイルをキープするスタイリングワックスです。インナー・スタイル成分配合。芯までうるおいが浸透し、柔軟でスタイル作りやすい髪へと導きます。エアキープ処方で、ふっくら丸みが思い通り。毛先のワンカールも続きます。<br> 使用方法：少量を手のひらでよく伸ばし、動きを出したい部分になじませたり、ふわっと浮かせるようにスタイリングする。 <br>ご注意：●頭皮に異常があるときは使わず、又異常が現れたときは使用をやめ、皮ふ科医等へ相談する。<br>●目に入ったときは、すぐに洗い流す。<br>●使用後はキャップをしめる。<br>●高温になる所や直射日光が当たる場所には置かない。<br>●乳幼児の手の届くところには置かない。<br> 成分<br>水、ミネラルオイル、ポリソルベート60、グリセリン、ジメチコン、ステアリルアルコール、ワセリン、ミツロウ、マイクロクリスタリンワックス、ステアリン酸ステアリル、パルミチン酸セチル、ステアリン酸ソルビタン、カルナウバロウ、ポリクオタニウム-7、アルギニンHCI、シクロペンタシロキサン、トレハロース、硫酸Na、アジピン酸、クエン酸、トリメチルシロキシケイ酸、ジメチコノール、フェノキシエタノール、ヒドロキシエチルセルロース、BHT、EDTA-2Na、安息香酸Na、メチルパラベン、プロピルパラベン、香料 <br>原産国：日本<br><br> お問い合わせ先：ユニリーバ・ジャパン株式会社お客さま相談室：0120-500-513受付時間：9-17時(土・日・祝日を除く)  <br>販売_製造元： ユニリーバ・ジャパン<br>ブランド：モッズ・ヘア<br>JAN：4902111727073<br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
